import React, { Component } from 'react';
import {
    MDBContainer,
    MDBRow,
    MDBCol
} from 'mdbreact';
import styled from 'styled-components';

const Wrapper = styled.div`
    height: 150px;
    border: 1px solid red;

    .image-container {
        height: 150px;
        padding: 0px;
        text-align: center;
    }

    .image {
        border: 1px solid red;
        border-radius: 10px;
        width: 90%;
        height: 100%;
    }
`;

class FeatureCard extends Component {
    render() {
        return (
            <Wrapper>
                <MDBContainer>
                    <MDBRow>
                        <MDBCol size="4" className="image-container">
                            <img className="image" src="https://cdn-image.foodandwine.com/sites/default/files/1501607996/opentable-scenic-restaurants-marine-room-FT-BLOG0818.jpg" />
                        </MDBCol>
                        <MDBCol size="8">
                            <MDBRow>
                                TELL YOUR STORY
                            </MDBRow>
                            <MDBRow>
                                Share your origins and journeys with the world, and teach customers about your culture!
                            </MDBRow>
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            </Wrapper>
        );
    }
}

export default FeatureCard;
